def gcdOfStrings(str1, str2):
    if str1 < str2:
        s = str1 #small
        b = str2 #big
    else:
        s = str2
        b = str1
    g = "" #greatest common denominator
    for i in reversed(range(len(s))): #go through prefixes of s from larger to smaller
        pg = s[0:i+1] #possible gcd
        if ((len(b)%len(pg)) == 0) & ((len(s)%len(pg)) == 0): #if s and b is divisible by pg
            if ((pg*int(len(b)/len(pg))) == b) & ((pg*int(len(s)/len(pg))) == s): #if pg * multiplied by this division amount satisfies the condition
                g = pg #then pg is gcd
                break

    return g

print(gcdOfStrings("ABCABC", "ABC"))
print(gcdOfStrings("ABABAB", "ABAB"))
print(gcdOfStrings("AA", "A"))
print(gcdOfStrings("", ""))
print(gcdOfStrings("LEET", "CODE"))